import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { FaUserCircle, FaSignOutAlt, FaChevronDown } from "react-icons/fa";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import axios from "axios";
import styles from "../styles/Dashboard.css"; // Adjust according to your file structure

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [showMenu, setShowMenu] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUserData = async () => {
      const token = localStorage.getItem("token");
      
      // If no token found, redirect to login
      if (!token) {
        navigate("/login");
        return;
      }

      console.log("Token retrieved:", token); // Check if token is found

      try {
        const response = await axios.get("http://localhost:8000/user", {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        if (response.data.success) {
          setUser(response.data.user);
        } else {
          toast.error("Failed to fetch user data.");
        }
      } catch (error) {
        console.error("Error fetching user data:", error.response || error.message);
        toast.error(
          error.response?.data?.message || "An error occurred while fetching user data."
        );
      }
    };

    fetchUserData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  const handleNavigate = (path) => {
    navigate(path);
  };

  return (
    <div className={styles.dashboardContainer}>
      <header className={styles.header}>
        <h1>CSE CU Association</h1>
        <div className={styles.userInfo} onClick={() => setShowMenu(!showMenu)}>
          {user && (
            <>
              <img
                src={user.profilePic || "https://via.placeholder.com/100"}
                alt="Profile"
                className={styles.profilePic}
              />
              <div>
                <p>{user.name}</p>
                <small>{user.email}</small>
              </div>
              <FaChevronDown size={15} className={styles.menuIcon} />
            </>
          )}
        </div>

        {showMenu && (
          <div className={styles.dropdownMenu}>
            <div className={styles.menuItem} onClick={() => handleNavigate("/profile")}>
              <FaUserCircle size={18} /> Profile
            </div>
            <div className={styles.menuItem} onClick={() => handleNavigate("/settings")}>
              <FaUserCircle size={18} /> Settings
            </div>
            <div className={styles.menuItem} onClick={handleLogout}>
              <FaSignOutAlt size={18} /> Logout
            </div>
          </div>
        )}
      </header>

      {user && (
        <div className={styles.welcomeSection}>
          <h2>Welcome back, {user.name}!</h2>
          <p>Here are your available options:</p>
        </div>
      )}

      <main className={styles.mainContent}>
        <button className={styles.dashboardButton} onClick={() => handleNavigate("/clubs")}>
          View Clubs
        </button>
        <button className={styles.dashboardButton} onClick={() => handleNavigate("/events")}>
          View Events
        </button>
        <button className={styles.dashboardButton} onClick={() => handleNavigate("/resources")}>
          View Resources
        </button>
      </main>

      <footer className={styles.footer}>
        <p>Â© {new Date().getFullYear()} CSE CU Association. All rights reserved.</p>
      </footer>

      <ToastContainer />
    </div>
  );
};

export default Dashboard;
